// Чекбокс с тремя состояниями для действий
class CellRendererThreeState : public Gtk::CellRenderer {
    public:
        CellRendererThreeState(int initial_state_idx);
        virtual ~CellRendererThreeState() {};

        typedef sigc::signal<void, Glib::ustring> type_signal_toggled;
        type_signal_toggled signal_toggled();
        void set_threestate(int next_render_state) { threestate_ = next_render_state; }
        void set_threestate_col_idx(int state_idx);

    protected:
        void render_vfunc(const Cairo::RefPtr<Cairo::Context>& cr,
                          Gtk::Widget& widget,
                          const Gdk::Rectangle& background_area,
                          const Gdk::Rectangle& cell_area,
                          Gtk::CellRendererState flags) override;

        bool activate_vfunc(GdkEvent* event,
                            Gtk::Widget& widget,
                            const Glib::ustring& path,
                            const Gdk::Rectangle& background_area,
                            const Gdk::Rectangle& cell_area,
                            Gtk::CellRendererState flags) override;

    private:
        type_signal_toggled signal_toggled_;
        int threestate_col_idx_ = -1;
        int threestate_ = 0;
};

// Чекбокс с тремя состояниями для действий группы
class CellRendererThreeStateGroup : public Gtk::CellRenderer {
    public:
        CellRendererThreeStateGroup(int initial_state_idx);
        CellRendererThreeStateGroup(): CellRendererThreeStateGroup(0) {};
        virtual ~CellRendererThreeStateGroup() {};

        typedef sigc::signal<void, Glib::ustring> type_signal_toggled;
        type_signal_toggled signal_toggled();
        void set_threestate(int next_render_state) { threestate_ = next_render_state; }
        void set_threestate_col_idx(int state_idx);

    protected:
        void render_vfunc(const Cairo::RefPtr<Cairo::Context>& cr,
                          Gtk::Widget& widget,
                          const Gdk::Rectangle& background_area,
                          const Gdk::Rectangle& cell_area,
                          Gtk::CellRendererState flags) override;

        bool activate_vfunc(GdkEvent* event,
                            Gtk::Widget& widget,
                            const Glib::ustring& path,
                            const Gdk::Rectangle& background_area,
                            const Gdk::Rectangle& cell_area,
                            Gtk::CellRendererState flags) override;

    private:
        type_signal_toggled signal_toggled_;
        int threestate_col_idx_ = -1;
        int threestate_ = 0;
};

// Модель используемая для пользователей и групп
class ObjCols : public Gtk::TreeModel::ColumnRecord {
    public:
        ObjCols() {
            add(icon);
            add(username);
            add(userpassw);
            add(name);
            add(grpname);
            // Полное имя пользователя, описание группы
            add(extrainfo);
            add(flags);
            add(flags_);
            add(allowtime);
            add(registertime);
            add(lastentertime);
            add(lastpwdchangetime);
            add(pwdkeepperiod);
            add(stations);
            add(droptimeout);
            add(psprdaccess);
            add(pspwraccess);
            add(psprdaccess_);
            add(pspwraccess_);
            add(priority_write);
            add(typeobject);
            add(sid);
            add(def_arm);
            add(allows_apps_names);
            add(allows_apps_enabled);
            add(allows_apps_permissions);
            add(allows_zones_names);
            add(allows_zones_permissions);
        }

        Gtk::TreeModelColumn<Glib::RefPtr<Gdk::Pixbuf>> icon;
        Gtk::TreeModelColumn<Glib::ustring> username;
        Gtk::TreeModelColumn<Glib::ustring> userpassw;
        Gtk::TreeModelColumn<Glib::ustring> name;
        Gtk::TreeModelColumn<Glib::ustring> grpname;
        Gtk::TreeModelColumn<Glib::ustring> extrainfo;
        // Значения чекбоксов (1 - разрешить назначать себя пользователем по умолчанию,
        // 2 - разрешить смену пароля пользователем,
        // 4 - назначить пользователем по умолчанию,
        // 64 - назначить права администратора,
        // 128 - потребовать смену пароля при следующем входе)
        Gtk::TreeModelColumn<unsigned char> flags;
        Gtk::TreeModelColumn<Glib::ustring> flags_;
        Gtk::TreeModelColumn<Glib::ustring> allowtime;
        Gtk::TreeModelColumn<Glib::ustring> registertime;
        Gtk::TreeModelColumn<Glib::ustring> lastentertime;
        Gtk::TreeModelColumn<Glib::ustring> lastpwdchangetime;
        Gtk::TreeModelColumn<int> pwdkeepperiod;
        Gtk::TreeModelColumn<Glib::ustring> stations;
        Gtk::TreeModelColumn<int> droptimeout;
        Gtk::TreeModelColumn<Glib::ustring> psprdaccess;
        Gtk::TreeModelColumn<Glib::ustring> pspwraccess;
        Gtk::TreeModelColumn<Glib::ustring> psprdaccess_;
        Gtk::TreeModelColumn<Glib::ustring> pspwraccess_;
        Gtk::TreeModelColumn<bool> priority_write;
        Gtk::TreeModelColumn<int> typeobject;
        Gtk::TreeModelColumn<Glib::ustring> sid;
        Gtk::TreeModelColumn<Glib::ustring> def_arm;

        // Следующие значения добавляются при первом включении чекбокса и изменяются (не удаляются) в дальнейшем
        // Имена приложений, для которых определены разрешения
        Gtk::TreeModelColumn<std::vector<std::string>> allows_apps_names;
        // Значения чекбокса приложений
        Gtk::TreeModelColumn<std::vector<bool>> allows_apps_enabled;
        // Плоский массив состоящий из блоков по 25 разрешений (0/1/2 как none/allow/deny) для действий опеределенных приложений
        Gtk::TreeModelColumn<std::vector<unsigned char>> allows_apps_permissions;
        // Имена зон, для которых определены разрешения
        Gtk::TreeModelColumn<std::vector<std::string>> allows_zones_names;
        // Массив состоящий из разрешений (0/1/2 как none/read_access/full_access) для каждой из определенных зон
        Gtk::TreeModelColumn<std::vector<unsigned char>> allows_zones_permissions;
};

